webpackJsonp([0x5d5f84dad089],{511:function(e,t){e.exports={data:{site:{siteMetadata:{title:"The Southbacon Blog",author:"Southbacon"}},markdownRemark:{id:"/Users/estrejlau/Projects/southbacon-blog/src/pages/posts/2018-06-29-testing-the-posts-folder.md absPath of file >>> MarkdownRemark",html:"<h1>I could if you hadn’t turned on the light and shut off my stereo.</h1>\n<p>Kif might! They’re like sex, except I’m having them! Dear God, they’ll be killed on our doorstep! And there’s no trash pickup until January 3rd. Aww, it’s true. I’ve been hiding it for so long.</p>\n<p>Our love isn’t any different from yours, except it’s hotter, because I’m involved. <strong>Guards!</strong> <em>Bring me the forms I need to fill out to have her taken away!</em> In our darkest hour, we can stand erect, with proud upthrust bosoms.</p>\n<h2>But existing is basically all I do!</h2>\n<p>Ok, we’ll go deliver this crate like professionals, and then we’ll go ride the bumper cars. Can we have Bender Burgers again? Your best is an idiot! I am the man with no name, Zapp Brannigan!</p>\n<ol>\n<li>I’ve got to find a way to escape the horrible ravages of youth. Suddenly, I’m going to the bathroom like clockwork, every three hours. And those jerks at Social Security stopped sending me checks. Now ‘I” have to pay ”them’!</li>\n<li>Check it out, y’all. Everyone who was invited is here.</li>\n<li>Ow, my spirit!</li>\n</ol>\n<h3>In your time, yes, but nowadays shut up! Besides, these are adult stemcells, harvested from perfectly healthy adults whom I killed for their stemcells.</h3>\n<p>No! The cat shelter’s on to me. It’s just like the story of the grasshopper and the octopus. All year long, the grasshopper kept burying acorns for winter, while the octopus mooched off his girlfriend and watched TV. But then the winter came, and the grasshopper died, and the octopus ate all his acorns. Also he got a race car. Is any of this getting through to you?</p>",frontmatter:{title:"Hello World",date:"June 29, 2018"}}},pathContext:{slug:"/posts/2018-06-29-testing-the-posts-folder/",previous:{fields:{slug:"/hello-world/"},frontmatter:{title:"Hello World"}},next:null}}}});
